CREATE OR REPLACE TRIGGER "VQOR4S"."TIB_DEVICE_COMM_ALARM" BEFORE INSERT ON "VQOR4S"."M_DEVICE" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
begin
  IF :OLD.COMMUNICATESTAUS = '1' AND :NEW.COMMUNICATESTAUS = '0' THEN
       'COMM_ALARM',
       sysdate,
       '0',
       :OLD.CONTROLLERID,
       TO_CHAR(:NEW.LASTCOMMUNICATETIME, 'yyyy-mm-dd hh24:mi:ss'));
  END IF;
end;
CREATE OR REPLACE TRIGGER "VQOR4S"."TIB_M_DEVICE" BEFORE INSERT ON "VQOR4S"."M_DEVICE" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
declare
    integrity_error  exception;
    errno            integer;
    errmsg           char(200);
    dummy            integer;
    found            boolean;

begin
    --  Column "DEVICEID" uses sequence S_device
    select S_device.NEXTVAL INTO :new.DEVICEID from dual;

--  Errors handling
exception
    when integrity_error then
       raise_application_error(errno, errmsg);
end;
